(24, 41, 'demouser', 'fun', 'Fun', 'Fun is the enjoyment of pleasure, particularly in leisure activities. Fun is an experience — short-term, often unexpected, informal, not cerebral and generally purposeless. It is an enjoyable distraction, diverting the mind and body from any serious task or contributing an extra dimension to it. Although particularly associated with recreation and play, fun may be encountered during work, social functions, and even seemingly mundane activities of daily living. It may often have little to no logical basis, and opinions on whether or not an activity is fun may differ. A distinction between enjoyment and fun is difficult but possible to articulate, fun being a more spontaneous, playful, or active event. There are psychological and physiological implications to the experience of fun.', 'https://en.wikipedia.org/wiki/Fun', 'fun', '2015-10-03 20:19:25', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(23, 41, 'demouser', 'operating systems', 'operating systems', 'An operating system (OS) is system software that manages computer hardware and software resources and provides common services for computer programs. The operating system is a component of the system software in a computer system. Application programs usually require an operating system to function.', 'https://en.wikipedia.org/wiki/Operating_system', 'operating systems', '2015-10-03 20:17:07', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(22, 41, 'demouser', 'general', 'general knowledge facts', '1. Turtles have no teeth.\r\n2. Prehistoric turtles may have weighed as much as 5,000 pounds.\r\n\r\n3. Only one out of a thousand baby sea turtles survives after hatching.\r\n\r\n4. Sea turtles absorb a lot of salt from the sea water in which they live. They excrete excess salt from their eyes, so it often looks as though they''re crying.\r\n\r\n5. Helium is a colourless, odourless, tasteless inert gas at room temperature and makes up about 0.0005% of the air we breathe.', 'http://www.kidswebindia.com/amazingfacts1.php', 'general knowledge', '2015-10-03 20:15:36', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(21, 41, 'demouser', 'programming', 'Cplusplus scanf command', 'int scanf ( const char * format, ... );\r\nRead formatted data from stdin\r\nReads data from stdin and stores them according to the parameter format into the locations pointed by the additional arguments.\r\n\r\nThe additional arguments should point to already allocated objects of the type specified by their corresponding format specifier within the format string.', 'http://www.cplusplus.com/reference/cstdio/scanf/', 'cplusplus,scanf', '2015-10-03 20:14:31', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(20, 41, 'demouser', 'programming', 'Cplusplus printf command', 'int printf ( const char * format, ... );\r\nWrites the C string pointed by format to the standard output (stdout). If format includes format specifiers (subsequences beginning with %), the additional arguments following format are formatted and inserted in the resulting string replacing their respective specifiers.', 'http://www.cplusplus.com/reference/cstdio/printf/', 'cplusplus,printf', '2015-10-03 20:12:25', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(25, 41, 'demouser', 'biology', 'biology', 'Biology is a natural science concerned with the study of life and living organisms, including their structure, function, growth, evolution, distribution, and taxonomy.[1] Modern biology is a vast and eclectic field, composed of many branches and subdisciplines. However, despite the broad scope of biology, there are certain general and unifying concepts within it that govern all study and research, consolidating it into single, coherent fields. In general, biology recognizes the cell as the basic unit of life, genes as the basic unit of heredity, and evolution as the engine that propels the synthesis and creation of new species. It is also understood today that all organisms survive by consuming and transforming energy and by regulating their internal environment to maintain a stable and vital condition.', 'https://en.wikipedia.org/wiki/Biology', 'biology', '2015-10-03 20:20:27', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(26, 41, 'demouser', 'biology', 'molecular biology', 'Molecular biology concerns the molecular basis of biological activity between the various systems of a cell, including the interactions between the different types of DNA, RNA and proteins and their biosynthesis, and studies how these interactions are regulated.', 'https://en.wikipedia.org/wiki/Molecular_biology', 'molecular biology', '2015-10-03 20:21:12', 0, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(27, 41, 'demouser', 'biology', 'Biomolecule', 'A biomolecule is any molecule that is present in living organisms, including large macromolecules such as proteins, polysaccharides, lipids, and nucleic acids, as well as small molecules such as primary metabolites, secondary metabolites, and natural products. A more general name for this class of material is biological materials.', 'https://en.wikipedia.org/wiki/Biomolecule', 'Biomolecule', '2015-10-03 20:22:31', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(28, 41, 'demouser', 'Person', 'Bjarne Stroustrup', 'Bjarne Stroustrup (born 30 December 1950) is a Danish computer scientist, most notable for the creation and development of the widely used C++ programming language. He is a Distinguished Research Professor and holds the College of Engineering Chair in Computer Science at Texas A&M University, a visiting professor at Columbia University, and works at Morgan Stanley.', 'https://en.wikipedia.org/wiki/Bjarne_Stroustrup', 'cplusplus,person', '2015-10-03 20:23:22', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(29, 41, 'demouser', 'programming', 'Variable (computer science)', 'In computer programming, a variable or scalar is a storage location paired with an associated symbolic name (an identifier), which contains some known or unknown quantity of information referred to as a value. The variable name is the usual way to reference the stored value; this separation of name and content allows the name to be used independently of the exact information it represents. The identifier in computer source code can be bound to a value during run time, and the value of the variable may thus change during the course of program execution.', 'https://en.wikipedia.org/wiki/Variable_(computer_science)', 'variables', '2015-10-03 20:24:20', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(30, 41, 'demouser', 'programming', 'Constant (computer programming)', 'In computer programming, a constant is an identifier with an associated value which cannot be altered by the program during normal execution – the value is constant.[a] This is contrasted with a variable, which is an identifier with a value that can be changed during normal execution – the value is variable. Constants are useful for both programmers and compilers: for programmers they are a form of self-documenting code and allow reasoning about correctness; while for compilers they allow compile-time and run-time checks that constancy assumptions are not violated, and allow or simplify some compiler optimizations.', 'https://en.wikipedia.org/wiki/Constant_(computer_programming)', 'cplusplus,programming', '2015-10-03 20:25:56', 1, 1, '106.51.137.160', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(31, 40, 'admin', 'Linux Package', 'How to create debian linux package', 'Link: http://linuxconfig.org/easy-way-to-create-a-debian-package-and-local-package-repository', 'http://linuxconfig.org/easy-way-to-create-a-debian-package-and-local-package-repository', 'Linux,Debian', '2015-10-19 06:13:42', 0, 1, '15.219.201.80', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'),
(32, 42, 'vsdpsingh', 'Linux Processes', 'How to kill background processes?', 'On Terminal type:\r\n$ bg\r\nOutput:\r\n[1]+ process1\r\n[2]+ process2\r\n\r\nto kill type command:\r\n$ kill %1', '', 'linux,linux process', '2015-11-04 05:10:17', 0, 1, '15.203.233.81', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.80 Safari/537.36'),
(33, 42, 'vsdpsingh', 'programming', 'Apache server is not starting?', 'Skype or VMWare must be installed on your system, which use port 80 and 443 by default. Hence there is a clash.\r\nchange in httpd.conf 80 -> 8080 where ever you find.\r\nListen 80\r\n\r\nServerName localhost:80\r\nto\r\nListen 8080\r\nServerName localhost:8080\r\n\r\n\r\nSimilarly in  httpd-ssl.conf \r\n\r\nListen 443\r\n<VirtualHost _default_:443>\r\n\r\nServerName localhost:443\r\n\r\nto\r\nListen 4443\r\n<VirtualHost _default_:4443>\r\n\r\nServerName localhost:4443\r\n\r\nBut from now on, you have to type localhost with http://localhost:8080/ (as per port number)', 'http://stackoverflow.com/questions/18300377/xampp-apache-error-apache-shutdown-unexpectedly', 'apache,windows', '2015-11-04 09:17:50', 0, 1, '15.203.233.81', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.80 Safari/537.36');

